import React from 'react';
import { Link } from 'react-router-dom';
import { Mail, Phone, MapPin, Instagram, Twitter, Youtube, Facebook } from 'lucide-react';
import './Footer.css';

const Footer = () => {
  const currentYear = new Date().getFullYear();

  const footerLinks = {
    'Quick Links': [
      { name: 'Home', path: '/' },
      { name: 'Shows', path: '/shows' },
      { name: 'About', path: '/about' },
      { name: 'Contact', path: '/contact' }
    ],
    'Services': [
      { name: 'Corporate Events', path: '/shows' },
      { name: 'Private Parties', path: '/shows' },
      { name: 'Comedy Workshops', path: '/shows' },
      { name: 'Open Mic Nights', path: '/shows' }
    ],
    'Resources': [
      { name: 'Booking Guide', path: '/contact' },
      { name: 'FAQ', path: '/contact' },
      { name: 'Testimonials', path: '/about' },
      { name: 'Press Kit', path: '/about' }
    ]
  };

  const socialLinks = [
    { icon: <Instagram size={20} />, href: '#', label: 'Instagram' },
    { icon: <Twitter size={20} />, href: '#', label: 'Twitter' },
    { icon: <Youtube size={20} />, href: '#', label: 'YouTube' },
    { icon: <Facebook size={20} />, href: '#', label: 'Facebook' }
  ];

  return (
    <footer className="footer">
      <div className="container">
        {/* Main Footer Content */}
        <div className="footer-content">
          {/* Brand Section */}
          <div className="footer-brand">
            <div className="brand-info">
              <h3>Onkar Yadav</h3>
              <p className="brand-subtitle">Comedian</p>
              <p className="brand-description">
                Bringing laughter to audiences across India with clean, 
                relatable comedy that everyone can enjoy.
              </p>
            </div>

            <div className="contact-info">
              <div className="contact-item">
                <Mail size={16} />
                <span>bookings@onkaryadav.com</span>
              </div>
              <div className="contact-item">
                <Phone size={16} />
                <span>+91 98765 43210</span>
              </div>
              <div className="contact-item">
                <MapPin size={16} />
                <span>Mumbai, Maharashtra</span>
              </div>
            </div>
          </div>

          {/* Footer Links */}
          <div className="footer-links">
            {Object.entries(footerLinks).map(([category, links]) => (
              <div key={category} className="footer-link-group">
                <h4>{category}</h4>
                <ul>
                  {links.map((link) => (
                    <li key={link.name}>
                      <Link to={link.path}>{link.name}</Link>
                    </li>
                  ))}
                </ul>
              </div>
            ))}
          </div>
        </div>

        {/* Footer Bottom */}
        <div className="footer-bottom">
          <div className="footer-bottom-content">
            <div className="copyright">
              <p>&copy; {currentYear} Onkar Yadav. All rights reserved.</p>
            </div>

            <div className="footer-bottom-links">
              <Link to="/privacy">Privacy Policy</Link>
              <Link to="/terms">Terms of Service</Link>
              <Link to="/cookies">Cookie Policy</Link>
            </div>

            <div className="social-links">
              {socialLinks.map((social, index) => (
                <a
                  key={index}
                  href={social.href}
                  className="social-link"
                  aria-label={social.label}
                >
                  {social.icon}
                </a>
              ))}
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
